import React from "react";
import { Grid } from '@material-ui/core';
import "./stylesheet.css";
import Navbar from "./Navbar.js";

function Landing() {
  return (
    <div className="row">
      <div className="Landing">
      <div className="logo"></div>
      <Navbar></Navbar>
    </div>
    <Grid container classname="landing-container">
      <Grid item sm={8}>
       <div className="bigimage"></div>
      </Grid>
      
    </Grid>
      
      
    <div className="row">
      <div className="landingtext">Design Frontiers is Design Coâ€™s annual design sprint where teams of creative, collaborative individuals tackle real problems in the world and design for innovation.</div>
    </div>
    
  </div>
  )
}

export default Landing;
